import React from 'react';

import axios from 'axios';

export default class List extends React.Component {
    state = {
        recette: []
      }

      componentDidMount() {
        axios.get(`https://api.spoonacular.com/recipes/complexSearch?apiKey=bbf788cda4f34fcc8b58403847622e97&number=100`)
          .then(res => {
            const recette = res.data.results;
            console.log(res.data),
            this.setState({ recette });
          })
      }

      render() {
          const recipe = this.state.recette[0]
        return (
          <ul>
            { JSON.stringify(recipe)}
            {/* <li>
                <img src={recipe.image}></img>
                <p>{recipe.title}</p>
            </li> */}
            { recipe.map(item => <li>{item.title}</li>)}

            {recipe}
          </ul>
        )
      }
}
